import ImgLogo from './img/logo.png'

const App = () => {

  const [value, setValue] = useState('')

  return (
    <div className="App">
      <Count/>
      <StreamText value={value} setValue={setValue} />
      <StreamTextClass value={value} setValue={setValue} />
      <Image image={ImgLogo} title='React logo'/>
    </div>
  );
}

export default App;
